os.atribuicoes14:
Encaminhar Termo de Referncia da Ao Educacional a ESC;
Definir o pblico do evento em conjunto com a Presidncia;
Enviar ofcios para Prefeitos e Secretrios de Sade e demais Autoridades;
Definir programao;
Encaminhar programao para Comunicao para diagramao;
Verificar a possibilidade de uso do Plenrio do TCE-MT para transmisso do encontro;
Encaminhar programao para ESC e demais unidades envolvidas;
Supervisionar o planejamento e a execuo da Ao Educacional;
Encaminhar CI/Convite para Membros, Procuradores e todas as unidades em conjunto com o Gabinete da Presidncia;
Definir em conjunto com o cerimonial, o dispositivo de honra;
Aprovar o roteiro em conjunto com cerimonial;
Encaminhar cpias dos ofcios para a ESC e Cerimonial;
Encaminhar para o Ncleo de Cerimonial cpias dos CIs, para confirmao de presena;
Encaminhar mini currculo dos painelistas a SECOM e Cerimonial;
Orar despesas da Ao Educacional;
Solicitar compra de passagem e hospedagem para palestrante;
Encaminhar a lista de painelistas e palestrantes que necessitaro de transporte;
Encaminhar a lista de painelistas e palestrantes que iro estacionar na frente da ESC;
Solicitar os slides das apresentaes aos painelistas e encaminhar para ESC at o dia 31/10/2024.

os.atribuicoes12:
Receber a demanda da Ao Educacional;
Compartilhar com o Conselheiro supervisor a demanda recebida;
Criar link de inscrio;
Definir equipe de trabalho;
Elaborar e acompanhar a matriz de responsabilidades, o checklist e demais documentos necessrios;
Gerenciar a ao educacional quanto aos aspectos operacionais, logsticos e de divulgao;
Encaminhar diariamente a lista de inscritos para a Comisso permanente de Sade e Assistncia Social do TCE-MT;
Solicitar servio de coffee break;
Organizar a montagem dos materiais da Ao Educacional: pastas, canetas e blocos de rascunho;
Organizar sala de Pessoas Importantes;
Solicitar Intrprete de libras;
Providenciar som ambiente no foyer, durante coffee break;
Solicitar canetas;
Providenciar transporte dos palestrantes e painelistas;
Encaminhar para o Gabinete Militar, a lista das painelistas e palestrantes para reserva espao de estacionamento na frente da Escola;
Liberar Certificado aos participantes

